import React, {useState, useEffect} from 'react';
import { Button, Container, Row, Col, Image } from 'react-bootstrap';
import { PostDTO } from './api/models/PostDTO';
import BlogPost from './BlogPost';
function BlogCard() {
    const [blogPost1, setBlogPost1] = useState<PostDTO>();
    const [blogPost2, setBlogPost2] = useState<PostDTO>();
    const [blogPost3, setBlogPost3] = useState<PostDTO>();
    const fetchBlogPost1 = () => {
        fetch("http://localhost:3000/post/pos1")
          .then(response => response.json())
          .then(data => setBlogPost1(data)) // assuming the array is stored in a property called posts
          .catch(error => console.log(error));
      }
        useEffect(() => {
            fetchBlogPost1();
          },[]);
          const fetchBlogPost2 = () => {
            fetch("http://localhost:3000/post/pos1")
              .then(response => response.json())
              .then(data => setBlogPost2(data)) // assuming the array is stored in a property called posts
              .catch(error => console.log(error));
          }
            useEffect(() => {
                fetchBlogPost2();
              }, []);
              const fetchBlogPost3 = () => {
                fetch("http://localhost:3000/post/pos1")
                  .then(response => response.json())
                  .then(data => setBlogPost3(data)) // assuming the array is stored in a property called posts
                  .catch(error => console.log(error));
              }
                useEffect(() => {
                    fetchBlogPost3();
                  }, []);
  return (
    <Container className="blog-slider">
      <Row className="blog-slider__item" style={{border: "2px solid black"}}>
        <Col xs={12} md={6} className="blog-slider__img">
          <Image
            src="https://res.cloudinary.com/muhammederdem/image/upload/q_60/v1535759872/kuldar-kalvik-799168-unsplash.webp"
            alt=""
            fluid
            className="img"
          />
        </Col>
        <Col xs={12} md={6} className="blog-slider__content">
          <span className="blog-slider__code">{blogPost1?.author}</span>
          <div className="blog-slider__title">{blogPost1?.title}</div>
          <div className="blog-slider__text">
            {blogPost1?.text}
          </div>
          <Button variant="primary" className="blog-slider__button">
            READ MORE
          </Button>
        </Col>
      </Row>
      <Row className="blog-slider__item" style={{border: "2px solid black"}}>
        <Col xs={12} md={6} className="blog-slider__img">
          <Image
            src="https://res.cloudinary.com/muhammederdem/image/upload/q_60/v1535759871/alessandro-capuzzi-799180-unsplash.webp"
            alt=""
            fluid
            className="img"
          />
        </Col>
        <Col xs={12} md={6} className="blog-slider__content">
          <span className="blog-slider__code">{blogPost2?.author}</span>
          <div className="blog-slider__title">{blogPost2?.title}</div>
          <div className="blog-slider__text">
            {blogPost2?.text}
          </div>
          <Button variant="primary" className="blog-slider__button">
            READ MORE
          </Button>
        </Col>
      </Row>
      <Row className="blog-slider__item" style={{border: "2px solid black"}}>
        <Col xs={12} md={6} className="blog-slider__img">
          <Image
            src="https://res.cloudinary.com/muhammederdem/image/upload/q_60/v1535759871/jason-leung-798979-unsplash.webp"
            alt=""
            fluid
            className="img"
          />
        </Col>
        <Col xs={12} md={6} className="blog-slider__content">
          <span className="blog-slider__code">{blogPost3?.author}</span>
          <div className="blog-slider__title">{blogPost3?.title}</div>
          <div className="blog-slider__text">
            {blogPost3?.text}
          </div>
          <Button variant="primary" className="blog-slider__button">
            READ MORE
          </Button>
        </Col>
      </Row>
    </Container>
  );
}
export default BlogCard;
